  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:48.035647\",\n\t\"name\": \"fish-use-of-several-tributaries-to-the-kenai-river-alaska-final-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is a summary of three Kenai River
  tributaries and the trout and salmon species that use them. The three Kenai River
  tributaries studied during 1982 and 1983 were all used by salmon and trout for spawning
  and/or rearing. Coho salmon spawning was observed in each stream and juvenile coho
  were the most abundant and widely distributed salmonid species found in each stream.
  Most of the observed Chinook salmon spawning occurred in Slikok Creek although some
  was observed in Beaver Creek. Juvenile chinook and sockeye salmon were found rearing
  in the lower reaches of each stream. Rainbow trout spawning was indicated in Beaver
  and Soldotna Creeks by the presence of recently emerged fry during July and August.
  Dolly Varden were found rearing in each stream. A variety of other, non-salmonid
  fishes was also found in each stream.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
